import React from "react";

function Jumbotron() {
    return (
        <div className="jumbotron jumbotron-fluid">
            <div className="container container-fluid">
                <h1 className="text-center"> BingeWatchers</h1>
            </div>
        </div>
    );
}

export default Jumbotron;
